    International Union of Operating Engineers has been changed to disclose the corrected
    FEC ID number.  2. The disbursements for \"\"Printing & Postage/Exempt Volunteer
    Mail - Heitkamp for Senate\"\" were volunteer mail pieces that fully met the definition
    of exempt activity.  3. The disbursements for \"\"Voter ID Expense\"\" were for
    paid phone calls. The results of these ID calls were posted to the Committee's
    voter file. All committees that have access to the voter file pay a fee for that
